import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  image: {
    width: '49px',
    height: '50px',
    // padding: '15px',
  },
  divizinha: {
    width: '100%',
    justifyContent: 'space-between',
    alignItems: 'center',
    flexDirection: 'row',
    padding:'5px',
    backgroundColor: '#fff',
  },
  txtSair:{
    color:'#f00',
    fontSize:'12pt',
    marginLeft:'10px'
  }
});
